import {doPostAsync} from "../api";
import {ip, tomcatPort} from "../../misc/constants";
import authHeader from "../user/auth-header";

const getPendingSession = () => {
    return doPostAsync(`http://${ip}:${tomcatPort}/api/charger/getPendingSession`, {}, authHeader());
}

export default getPendingSession;
